import React from "react";
import { Card } from "react-bootstrap";
import { Container } from "react-bootstrap";

const MainPage = (props) => {
    const handleClick = (e) => {
        console.log('this is:', e);
        e.toggleClass("heart_animate");
    }
    return (
        <div>
            <Container id="ContainerMainPage">
                <Card id="card" style={{ width: '15rem' }}>
                    <Card.Img id="cardimg" variant="top" src="https://bucket-img.tnlmedia.com/cabinet/files/consoles/2/teams/2/2021/9/ykvE14QMdpeEcShwkQr1T5H4IVTHV2dCVsXNCnuG.jpg" />
                    <Card.Body>
                        <div class="heart" onClick={handleClick}></div>
                        <label style={{ color: 'white' }}>06/10/21</label>
                    </Card.Body>
                </Card>
            </Container>
        </div>
    )
}
export default MainPage;
